style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("wikipedia.org") {
  
   body, html {background: rgba(0,0,0, .05)url(/*[[URL]]*/)!important; 
  background-color: #111 !important;
	background-attachment: fixed !important;
	background-clip: border-box !important;
	background-origin: padding-box !important;
	background-position: center center !important;
	background-repeat: no-repeat !important;
	background-size: cover !important;
  font-family:Constantia!important} 
   
   #p-logo a, #mw-content-text > table:nth-child(1) {background-image: url(data:image/png;base64,)!important;}
 #p-logo a:hover, #mw-content-text > table:nth-child(1):hover {background-image: url(http://savepic.org/7172651.png)!important}
   .globegris{ background : url(http://upload.wikimedia.org/wikipedia/commons/4/4e/Wiki-black.png) left no-repeat  !important;background-size: contain !important;height: 100px !important;}
  
    #mw-content-text > table:nth-child(1) {background: url(http://upload.wikimedia.org/wikipedia/commons/4/4e/Wiki-black.png) left no-repeat  !important;background-size: contain !important}
   
     
  .mw-body, div#mw-panel {background: rgba(0, 0, 0,  0.75)!important; box-shadow: 0px 0px 8px rgba(255, 255, 255,  .9 )inset !important}
    
  div.vectorTabs ul li, #NavFrame0, .navbox-title, #collapsibleTable7>tbody>tr>th, div.NavFrame div.NavHead, body>a {background: rgba(0, 0, 0,  0.7)!important}
  div#simpleSearch, .mw-ui-input  {background: rgba(0, 0, 0,  0.7)!important; box-shadow: 0px 0px 4px rgba(255, 255, 255,  1 ) !important}
  blockquote {background: rgba(0, 255, 255,  0.1)!important;border-radius: 35px 0px 35px 0px !important}
  #toc, .toc, .mw-warning, .toccolours, .infobox>tbody>tr>th{background: rgba(105, 105, 105,  0.4)!important; border:none !important;border-radius: 35px 0px 35px 0px !important;box-shadow: 0px 0px 20px rgba(0, 0, 0,  .9 )inset !important}
  table.standard th, table.wide th, table.prettytable th,.standard>tbody>tr>td, #wpTextbox1, #wpSummary, table.wikitable > tr > th, table.wikitable > * > tr > th {background: rgba(125, 125, 125,  0.3)!important; border-color: black !important}
  .wikiEditor-ui-toolbar, .editOptions, div.flaggedrevs_preview, .mw-search-profile-tabs, #centralNotice>div {background: rgba(0, 255, 255,  0.1)!important}
  #mw-content-text>dl>dd>img {background: rgba(255, 255, 255,  0.7)!important;border-radius: 10px 10px 10px 10px !important}
  #mw-content-text>table>tbody>tr>td>div, #mw-content-text>div>div, #mw-content-text>table>tbody>tr>td>table>tbody>tr  {background: rgba(0, 255, 255,  0.05)!important}
  div.vectorTabs ul li:hover, body>a:hover {background: rgba(0, 0, 0,  0.9)!important; box-shadow: 0px 0px 8px rgba(0, 255, 255,  .9 ) inset !important}
     .mw-ui-button.mw-ui-constructive, .mw-ui-button.mw-ui-progressive, .mw-ui-button.mw-ui-primary  {background: none repeat scroll 0% 0% #39F;color: #000;border: none;}
    
   #mw-page-base, div.vectorTabs span, #mw-content-text>table, div.vectorTabs, .navbox, .navbox-subgroup, .navbox th, div#mw-panel div.portal, .catlinks, div.thumbinner, #talkheader>tbody>tr>td, #talkheader>tbody>tr>td>table>tbody>tr>td, .informationbox, #pagehistory li.selected, .wikiEditor-ui, #userSummaryButtonsA a, .mw-mmv-post-image, .mw-mmv-image-metadata, #mw-content-text>table>tbody>tr>td, #mw-content-text>table>tbody>tr>td>table>tbody>tr>td, hr, #mw-content-text>div, #mw-content-text>table>tbody> tr>td>table, #mw-content-text>table>tbody>tr>td>table>tbody>tr>td>table, table.infobox>tbody>tr>td>div, #newarticletext>div>table, #newarticletext>div>div, .mw-createacct-captcha-container  {background: transparent !important}
      
  .mw-body, .globegris, #mw-content-text>table>tbody>tr>td>div, #NavFrame0, .navbox, .navbox-subgroup, div#simpleSearch, blockquote, .catlinks, h1, h2, h3, h4, h5, h6, div.thumbinner, body>a, #talkheader>tbody>tr>td, table.tmbox-protection, table.tmbox-notice, #talkheader>tbody>tr>td>table>tbody>tr>td, .informationbox, .editOptions, #editpage-specialchars, .wikiEditor-ui .wikiEditor-ui-top, .wikiEditor-ui .wikiEditor-ui-view, .wikiEditor-ui-toolbar .group, .messagebox.standard-talk, #userSummaryButtonsA a, #pagehistory li.selected, #pagehistory li, .mw-mmv-image-metadata, div.flaggedrevs_diffnotice, div.flaggedrevs_preview, #mw-content-text>table, #mw-content-text>table>tbody>tr>td, #mw-content-text>table>tbody>tr>td>table>tbody>tr>td, #mw-content-text>div, #mw-content-text>table>tbody>tr>td>table>tbody>tr>td>div, #mw-content-text>div>div, .mw-search-profile-tabs, #mw-content-text>table>tbody> tr>td>table, #mw-content-text>table>tbody>tr>td>table>tbody>tr>td>table>tbody>tr>td, #newarticletext>div, .mw-createacct-captcha-container  {border: none !important}
    
  div.vectorTabs li a, a, .globegris>table>tbody>tr>td>table>tbody>tr>td>div, .globegris>table>tbody>tr>td, .globegris>table>tbody>tr>td>table>tbody>tr>td, div#simpleSearch input {color: /*[[1]]*/ !important; text-decoration: none !important}
  
  a:hover, h1 {color: /*[[link]]*/ !important; text-decoration: none !important}
    
 .mw-body,  h2, h3, h4, h5, h6, div#mw-panel div.portal h3, div.flaggedrevs_preview, .infobox>tbody>tr>th, #mw-content-text>div, #mw-content-text>div>div, table.wikitable {color: /*[[2]]*/ !important; text-decoration: none !important}

}
